[virtual_sdcard]
path: ~/printer_data/gcodes
on_error_gcode: CANCEL_PRINT


#dfsdf
[include Autotune.cfg]
[include sovol-macros.cfg]

#[include timelapse.cfg] # DONT FORGET TO INSTALL THE TIMELAPSE PLUGIN
#[include fluidd.cfg]
#[include custom_sens.cfg]
[include line_purge.cfg]

[include custom_macro.cfg]
# PLEASE UNCOMMENT THE FILE THAT BEST FITS YOUR CONFIGURATION

# IF YOU ARE USING THE SCREEN THAT COMES WITH THE SV08

[include options/RP2040_00.cfg]
#[include options/spoolman.cfg]
[include options/cartographer.cfg]

#[include options/lcd/*.cfg]
[display_status]
# If you are using the stock probe, keep the following lines as-is.
# If you have an Eddy probe, comment the first and uncomment the second,
# then go read options/probe/eddy.cfg. 
# Also, when using eddy, comment out/remove the [probe] section here in the printer.cfg
#[include options/probe/stock.cfg]
#[include options/probe/eddy.cfg]
[include shaketune.cfg]
[respond]
[include chopper_tune.cfg]
[include options/neopixel.cfg]
[include options/additions_kaliko.cfg]
[include options/auto_zoffset.cfg]
[skew_correction] 

[mcu]
serial: /dev/serial/by-id/usb-Klipper_stm32f103xe_32FFDA054747363011781057-if00
restart_method: command    

[mcu extra_mcu]
serial: /dev/serial/by-id/usb-Klipper_stm32g0b1xx_040026000F504B5735313720-if00
restart_method: command      

[printer]
kinematics: corexy           
max_velocity: 700            
max_accel: 15000             
minimum_cruise_ratio: 0.5
max_z_velocity: 40           
max_z_accel: 700             
square_corner_velocity: 10.0 

[stepper_x]
step_pin: PE2
dir_pin: !PE0
enable_pin: !PE3
rotation_distance: 40         
microsteps: 64                
full_steps_per_rotation:200   
endstop_pin: tmc2209_stepper_x: virtual_endstop              
position_min: 0               
#position_endstop: 354 Паралелные каретки     
#position_max: 354             
position_endstop: 358         
position_max: 358  

homing_speed: 50              
homing_retract_dist: 0        
homing_positive_dir: True   
high_precision_step_compress: True  
#--------------------------------------------------------------------
[tmc2209 stepper_x]
uart_pin: PE1
interpolate: True             
run_current: 1.1              
##hold_current: 1.1             
sense_resistor: 0.150         
stealthchop_threshold: 0      
uart_address:3
driver_sgthrs: 95
diag_pin: PE15

#chopper_tune
#driver_TBL: 3
#driver_TOFF: 9
#driver_HSTRT: 3
#driver_HEND: 3

#с мотора
#chopper_tune
#driver_TBL: 3
#driver_TOFF: 3
#driver_HSTRT: 0
#driver_HEND: 2

#--- RRF3D ---
# driver_TBL: 1
# driver_TOFF: 8
# driver_HSTRT: 7
# driver_HEND: 8

#LEDSHINE
#run_current: 1.527
#interpolate: false
#stealthchop_threshold: 0
driver_IHOLDDELAY: 8        # Default 8
driver_TPOWERDOWN: 20       # Default 20
driver_TBL: 0               # Default 2
driver_TOFF: 3              # Default 3
driver_HEND: 0              # Default 0
driver_HSTRT: 2             # Default 5
driver_PWM_AUTOGRAD: False  # Default True
driver_PWM_AUTOSCALE: False # Default True
driver_PWM_LIM: 12          # Default 12
driver_PWM_REG: 8           # Default 8
driver_PWM_FREQ: 2          # Default 1
driver_PWM_GRAD: 18         # Default 14
driver_PWM_OFS: 36

[stepper_y]
step_pin: PB8
dir_pin: !PB6
enable_pin: !PB9
rotation_distance: 40         
microsteps: 64                
full_steps_per_rotation:200   
endstop_pin: tmc2209_stepper_y: virtual_endstop              
position_min: 0               
position_endstop: 360         
position_max: 360            
homing_speed: 50              
homing_retract_dist: 0        
homing_positive_dir: true   
high_precision_step_compress: True  
#--------------------------------------------------------------------
[tmc2209 stepper_y]
uart_pin: PB7
interpolate: True             
run_current: 1.1              
##hold_current: 1.1             
sense_resistor: 0.150         
stealthchop_threshold: 0      
uart_address:3
driver_sgthrs: 95
diag_pin: PE13 

#chopper_tune
#driver_TBL: 3
#driver_TOFF: 9
#driver_HSTRT: 3
#driver_HEND: 3

#с мотора
#chopper_tune
#driver_TBL: 3
#driver_TOFF: 3
#driver_HSTRT: 0
#driver_HEND: 2

#--- RRF3D ---
#driver_TBL: 1
#driver_TOFF: 8
#driver_HSTRT: 7
#driver_HEND: 8

#LEDSHINE
#run_current: 1.527
#interpolate: false
#stealthchop_threshold: 0
driver_IHOLDDELAY: 8        # Default 8
driver_TPOWERDOWN: 20       # Default 20
driver_TBL: 0               # Default 2
driver_TOFF: 3              # Default 3
driver_HEND: 0              # Default 0
driver_HSTRT: 2             # Default 5
driver_PWM_AUTOGRAD: False  # Default True
driver_PWM_AUTOSCALE: False # Default True
driver_PWM_LIM: 12          # Default 12
driver_PWM_REG: 8           # Default 8
driver_PWM_FREQ: 2          # Default 1
driver_PWM_GRAD: 18         # Default 14
driver_PWM_OFS: 36

[stepper_z] #motherboard：Z3 
step_pin:PC0    
dir_pin:PE5    
enable_pin:!PC1    
rotation_distance: 40         
gear_ratio: 80:12             
microsteps: 64                
endstop_pin: probe:z_virtual_endstop           
position_max: 347             
position_min: -5              
#position_endstop: 0
homing_speed: 25.0
homing_retract_dist: 0
homing_retract_speed: 25.0
second_homing_speed: 10.0
high_precision_step_compress: True

[tmc2209 stepper_z]
uart_pin: PE6 
interpolate: False             
run_current: 0.55           
#hold_current: 0.58         
sense_resistor: 0.150         
stealthchop_threshold: 0 
uart_address:3

[stepper_z1] ##motherboard：Z1
step_pin:PD3  
dir_pin:!PD1 
enable_pin:!PD4 
rotation_distance: 40         
gear_ratio: 80:12            
microsteps: 64               
high_precision_step_compress: True

[tmc2209 stepper_z1]
uart_pin:PD2  
interpolate: False             
run_current:  0.55          
#hold_current: 0.58           
sense_resistor: 0.150         
stealthchop_threshold: 0 
uart_address:3

[stepper_z2] ##motherboard：Z2
step_pin:PD7
dir_pin:PD5   
enable_pin:!PB5
rotation_distance: 40         
gear_ratio: 80:12             
microsteps: 64                
high_precision_step_compress: True

[tmc2209 stepper_z2]
uart_pin:PD6  
interpolate: False             
run_current: 0.55            
#hold_current: 0.58           
sense_resistor: 0.150         
stealthchop_threshold: 0 
uart_address:3

[stepper_z3] ##motherboard：Z4
step_pin:PD11 
dir_pin:!PD9 
enable_pin:!PD12   
rotation_distance: 40         
gear_ratio: 80:12             
microsteps: 64                
high_precision_step_compress: True

[tmc2209 stepper_z3]
uart_pin:PD10    
interpolate: False            
run_current: 0.55         
#hold_current: 0.58           
sense_resistor: 0.150         
uart_address:3
stealthchop_threshold: 0 


[extruder]
step_pin: extra_mcu:PD0  
dir_pin: extra_mcu:PD1    
enable_pin:!extra_mcu:PD2   
rotation_distance: 4.712 #orbiter 2.5
microsteps: 16                
full_steps_per_rotation: 200 
nozzle_diameter: 0.400        
filament_diameter: 1.75  
max_extrude_only_distance: 1000     
max_extrude_cross_section: 80     
heater_pin:extra_mcu:PB13  
sensor_type: ATC Semitec 104NT-4-R025H42G
sensor_pin: extra_mcu:PA3 
min_temp: 5                  
max_temp: 305                 
max_power: 1.0                
min_extrude_temp: 50
pressure_advance: 0.025       
pressure_advance_smooth_time: 0.035    

[tmc2209 extruder]
uart_pin: extra_mcu:PA15  
interpolate: true             
#run_current: 0.6 #stock
run_current: 0.6 #Orbiter 2.5           
hold_current: 0.4  # Уменьшаем, чтобы мотор не грелся на паузах
#hold_current: 0.75             
sense_resistor: 0.110          
stealthchop_threshold: 9999


#[z_thermal_adjust Nozzle]
#sensor= extruder
#temp_coeff=-0.00055232558
#max_z_adjustment: 0.2

[firmware_retraction]
retract_length: 0.5
retract_speed: 30
unretract_extra_length: 0
unretract_speed: 25

[verify_heater extruder]      
max_error: 50                
check_gain_time: 20           
hysteresis: 3                
heating_gain: 3               

[filament_switch_sensor filament_sensor]
pause_on_runout: True
event_delay: 3.0
pause_delay: 0.5
switch_pin: PE9

[thermistor my_thermistor]
temperature1:25
resistance1:100000
temperature2:50
resistance2:18085.4
temperature3:100
resistance3:5362.6

[heater_bed]
heater_pin:PA0
sensor_type: my_thermistor  
sensor_pin: PC5
max_power: 1.0               
min_temp: 5                  
max_temp: 105                

[verify_heater heater_bed]      
max_error: 30                
check_gain_time: 40           
hysteresis: 3                
heating_gain: 2 


#[probe_pressure]
#pin: ^!PE12     
#x_offset: 0                  
#y_offset: 0
#z_offset : 0
#speed: 1.0

[quad_gantry_level]          
gantry_corners:              
	-60,-45
	415,470
points:
	35,2
	35,295
	320,295
	320,2
speed: 600                   
horizontal_move_z: 20       
retry_tolerance: 0.005      
retries: 7                  
max_adjust: 30   



#Stock
#[multi_pin print_cooling_fan_pins]
#pins: extra_mcu:PA7, extra_mcu:PB1
# print/part cooling fan
#[fan] #Stock
#pin: multi_pin:print_cooling_fan_pins
#max_power: 1.0

[fan]
pin: extra_mcu:PA0
max_power: 1.0

#[fan_generic exhaust_fan] # exhaust fan
#pin: PA2
#max_power: 1.0

[fan_generic Filter_fan] # exhaust fan
pin: PA2
max_power: 1.0

# MCU fan, aka noisy boi, is now only enabled when using steppers, extruder, heatbed; 5min timeout
[controller_fan MCU_fan]
pin: PA1
max_power: 1
kick_start_time: 0.5
fan_speed: 1
idle_timeout: 300
heater: extruder, heater_bed
stepper: stepper_x, stepper_y

# Want your fan (host) temperature controlled? Uncomment the next section and comment out the above section, derived from: https://www.reddit.com/r/Sovol/comments/1cqntzu/first_mod_on_my_sv08_noctua_fan_for_the/
# WARNING: Do you have a Noctua 24V 4010 fan (eg. NF-A4x10 24V PWM)? Then this will not work and results in a non-spinning fan.
# In that case you can either use the above 'controller_fan' section or use 'control: watermark' and leave the pid entries commented out.
#[temperature_fan MCU_fan]
#pin: PA1
#kick_start_time: 0.5
#max_power: 1.0
#min_temp: 0
#max_temp: 90
#hardware_pwm: true
#target_temp: 50
#sensor_type: temperature_host # please comment out or remove the [temperature_sensor Host_temp] section if you don't want the temperature shown twice in the interface.
#max_speed: 1.0
#min_speed: 0.1
#control: pid
#pid_Kp: 2.0     ;40
#pid_Ki: 5.0     ;0.2
#pid_Kd: 0.5     ;0.1
#pid_deriv_time: 2.0
#control: watermark # use this control if pid control does not work for your fan

[heater_fan hotend_fan]      
pin: extra_mcu:PA1   
max_power: 1.0
kick_start_time: 0.5         
heater: extruder             
heater_temp: 50              


[gcode_arcs]                       
resolution: 1.0                

# Defined as an LED for ease of control
[led main_led]
white_pin:PA3
cycle_time: 0.005
hardware_pwm: False
initial_WHITE: 1.0

[idle_timeout]
gcode: _IDLE_TIMEOUT
timeout: 600

[temperature_sensor mcu_temp]         
sensor_type: temperature_mcu
min_temp:0
max_temp:100

[temperature_sensor Host_temp]     
sensor_type: temperature_host
min_temp: 0
max_temp: 110

[temperature_sensor Toolhead_Temp]
sensor_type: temperature_mcu
sensor_mcu: extra_mcu


[pause_resume]

[exclude_object]

#[adxl345]
#cs_pin:extra_mcu:PB12
#axes_map: x, -z, y

[resonance_tester]
accel_chip: adxl345
probe_points:
    175, 175, 30  # an example175 Y175 Z30
sweeping_period: 1.2
#accel_per_hz: 50
#min_freq: 1
#max_freq: 100
#max_smoothing: 0.2
#hz_per_sec: 0.5

[input_shaper]
damping_ratio_x: 0.044
damping_ratio_y: 0.057
shaper_type_x = mzv
shaper_type_y = mzv
shaper_freq_x = 63.8
shaper_freq_y = 45.4


